/**
 * 浏览器支持校验
 */
!(function () {
  // 显示浏览器不支持的提示信息
  function showNotSupported () {
    var cssText = 'html,body{background:#F7F8F8;}.not-supported{margin:0 auto;padding-top:100px;max-width:90%;text-align:center;font-size:16px;color:#999;line-height:2;}.not-supported-img{width:551px;height:300px;}.not-supported-msg{margin-top:30px;}@media (max-width:540px){.not-supported-img{width:100%;height:54.446%}}';
    var styleNode = document.createElement('style');
    styleNode.setAttribute('type','text/css');
    document.getElementsByTagName('head')[0].appendChild(styleNode);
    if (styleNode.styleSheet) {
      styleNode.styleSheet.cssText = cssText;
    }else {
      var textNode = document.createTextNode(cssText);
      styleNode.appendChild(textNode);
    }
    document.body.innerHTML = '<div class=not-supported><img class=not-supported-img src="data:image/png;base64,"><p class=not-supported-msg>请使用 Chrome 或者 Firefox 或者 IE9 及以上的浏览器。</div>';
  }

  function ready(fn){
    if(document.addEventListener) {//标准浏览器
      document.addEventListener('DOMContentLoaded', function() {
        document.removeEventListener('DOMContentLoaded',arguments.callee, false);
        fn();
      }, false);
    }else if(document.attachEvent) {//IE
      document.attachEvent('onreadystatechange', function() {
        if(document.readyState == 'complete') {
          document.detachEvent('onreadystatechange', arguments.callee);
          fn();
        }
      });
    }
  };

  var ua = navigator.userAgent;
  var isIE = false;
  var version = 0; // IE 版本
  if (/MSIE ([^;]+)/.test(ua)){
    isIE = true;
    version = parseInt(RegExp.$1);
  } else if('ActiveXObject' in window){
    isIE = true;
    version = 11;
  }

  if (isIE) {
    window.__ieVersion = version; // 设置全局变量
    window.document.documentElement.setAttribute('ie-version', version); // html标签设置属性
    // 如果 IE9 以下浏览器，显示浏览器不支持提示信息
    if (version < 9) {
      ready(showNotSupported);
    }
  }
})();
